# ------------- Functions -------------

def utf16encode(text):
    return text.encode('utf-16le') + b'\x00\x00'

def calctempotimed(i_value):
    global FL_Main
    i_tempomul = 120/FL_Main['Tempo']
    i_out = (i_value*i_tempomul)*125
    #print('VALUE', str(i_value).ljust(20), '| MUL', str(i_tempomul).ljust(20), '| OUT', str(i_out).ljust(20))
    return i_out

# ------------- make -------------
def make_flevent(FLdt_bytes, value, data):
    if value <= 63 and value >= 0: # int8
        FLdt_bytes.write(value.to_bytes(1, "little"))
        FLdt_bytes.write(data.to_bytes(1, "little"))
    if value <= 127 and value >= 64 : # int16
        FLdt_bytes.write(value.to_bytes(1, "little"))
        FLdt_bytes.write(data.to_bytes(2, "little"))
    if value <= 191 and value >= 128 : # int32
        FLdt_bytes.write(value.to_bytes(1, "little"))
        FLdt_bytes.write(data.to_bytes(4, "little"))
    if value <= 224 and value >= 192 : # text
        FLdt_bytes.write(value.to_bytes(1, "little"))
        FLdt_bytes.write(varint.encode(len(data)))
        FLdt_bytes.write(data)
    if value <= 255 and value >= 225 : # data
        FLdt_bytes.write(value.to_bytes(1, "little"))
        FLdt_bytes.write(varint.encode(len(data)))
        FLdt_bytes.write(data)
def make_arrangement(data_FLdt, arrangements):
    for arrangement in arrangements:
        make_flevent(data_FLdt, 99, int(arrangement)) #NewArrangement
        if 'name' in arrangements[arrangement]:
            make_flevent(data_FLdt, 241, utf16encode(arrangements[arrangement]['name'])) #ArrangementName
        placements = arrangements[arrangement]['items']
        BytesIO_arrangement = BytesIO()
        for item in placements:
            BytesIO_arrangement.write(item['position'].to_bytes(4, 'little'))
            BytesIO_arrangement.write(item['patternbase'].to_bytes(2, 'little'))
            BytesIO_arrangement.write(int(item['itemindex']).to_bytes(2, 'little'))
            BytesIO_arrangement.write(int(item['length']).to_bytes(4, 'little'))
            BytesIO_arrangement.write(item['trackindex'].to_bytes(4, 'little'))
            BytesIO_arrangement.write(item['unknown1'].to_bytes(2, 'little'))
            BytesIO_arrangement.write(item['flags'].to_bytes(2, 'little'))
            BytesIO_arrangement.write(item['unknown2'].to_bytes(2, 'little'))
            BytesIO_arrangement.write(item['unknown3'].to_bytes(2, 'little'))

            if int(item['itemindex']) > item['patternbase']:
                if 'startoffset' in item: BytesIO_arrangement.write(item['startoffset'].to_bytes(4, 'little'))
                else: BytesIO_arrangement.write(b'\xff\xff\xff\xff')
                if 'endoffset' in item: BytesIO_arrangement.write(item['endoffset'].to_bytes(4, 'little'))
                else: BytesIO_arrangement.write(b'\xff\xff\xff\xff')
            else:
                startoffset_out = -1
                endoffset_out = -1

                if 'startoffset' in item: startoffset_out = calctempotimed(item['startoffset'])
                if 'endoffset' in item: endoffset_out = calctempotimed(item['endoffset'])

                BytesIO_arrangement.write(struct.pack('<f', startoffset_out))
                BytesIO_arrangement.write(struct.pack('<f', endoffset_out))



        BytesIO_arrangement.seek(0)
        make_flevent(data_FLdt, 36, 0)
        make_flevent(data_FLdt, 233, BytesIO_arrangement.read()) #PlayListItems
        if 'tracks' in arrangements[arrangement]:
            make_trackinfo(data_FLdt, arrangements[arrangement]['tracks'])
        if 'timemarkers' in arrangements[arrangement]:
            make_timemarkers(data_FLdt, arrangements[arrangement]['timemarkers'])
def make_timemarkers(data_FLdt, timemarkers):
    for timemarker in timemarkers:
        timemarker_item = timemarkers[timemarker]
        timemarkertype = timemarker_item['type'] << 24
        timemarkertime = timemarker_item['pos']
        make_flevent(data_FLdt, 148, timemarkertype+timemarkertime)
        if 'numerator' in timemarker_item: make_flevent(data_FLdt, 33, timemarker_item['numerator'])
        else: make_flevent(data_FLdt, 33, 4)
        if 'denominator' in timemarker_item: make_flevent(data_FLdt, 34, timemarker_item['denominator'])
        else: make_flevent(data_FLdt, 34, 4)
        if 'name' in timemarker_item: make_flevent(data_FLdt, 205, utf16encode(timemarker_item['name']))
        else: make_flevent(data_FLdt, 205, b'\x20\x00\x00\x00')
def make_basicparams(data_FLdt, channel):
    basicp_pan = 0
    basicp_volume = 0.78125
    basicp_pitch = 0
    if 'pan' in channel: basicp_pan = channel['pan']
    if 'volume' in channel: basicp_volume = channel['volume']
    if 'pitch' in channel: basicp_pitch = channel['pitch']
    basicp_pan = int(xtramath.clamp((basicp_pan/2)+0.5, 0, 1)*12800)
    basicp_volume = int(xtramath.clamp(basicp_volume, 0, 1)*12800)
    
    bio_basicparams = BytesIO()
    bio_basicparams.write(basicp_pan.to_bytes(4, "little"))
    bio_basicparams.write(basicp_volume.to_bytes(4, "little"))
    bio_basicparams.write(int(basicp_pitch).to_bytes(4, "little", signed="True"))
    bio_basicparams.write(b'\x00\x01\x00\x00\x00\x00\x00\x00\x00\x00\x00\x00')
    bio_basicparams.seek(0)
    make_flevent(data_FLdt, 219, bio_basicparams.read())
def make_poly(data_FLdt, channel):
    temp_polymax = 0
    temp_polyslide = 500
    temp_polyflags = 0
    if 'polymax' in channel: temp_polymax = channel['polymax']
    if 'polyslide' in channel: temp_polyslide = channel['polyslide']
    if 'polyflags' in channel: temp_polyflags = channel['polyflags']
    bio_poly = BytesIO()
    bio_poly.write(temp_polymax.to_bytes(4, "little"))
    bio_poly.write(temp_polyslide.to_bytes(4, "little"))
    bio_poly.write(temp_polyflags.to_bytes(1, "little"))
    bio_poly.seek(0)
    make_flevent(data_FLdt, 221, bio_poly.read())
